import './App.css';
import NewTodo from './components/NewTodo';
import Todos from './components/Todos';
import Todo from './models/todo';
function App() {
const todos =[
new Todo('Learn no'),
new Todo('Learn yes')
];

  return (
    <div>
<Todos items={todos}/>
<NewTodo></NewTodo>
    </div>
  );
}

export default App;
